import React from "react"
import './Home.css'
import {people}  from '../../../utils/data'


function Home(){
    return (
        <div>
        <div className="title"><h1>Birthday App</h1></div>
    <div>
    <input className={"form-control form-control-lg search-main"} type={"text"} placeholder={"Friend Name"}></input>
    </div>
    
    <div className={"btn-search"}>
    <button type={"button"} className={"btn btn-secondary"}>Add</button>
    </div>


    <div className="card-list">
        {people.map((person)=>{return <div> <h2>person.name</h2> <h2>person.birthday</h2></div>})}
    </div>
        </div>
    )
}


export default Home;
